import React from 'react';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage'
import AdvancedAuthenticationPage from './pages/AdvancedAuthenticationPage';


function App() {
  return (
    <div className="App">
       <Navbar />
       <HomePage />
       <AdvancedAuthenticationPage />
    </div>
  );
}

export default App;
